import { Route, Routes } from 'react-router-dom';
import './App.css';
import SignIn from './pages/Signin'

function App() {
  return (
    <div className="App">
      <SignIn />
      <Routes>
        <Route path='/' element = {<SignIn />} />
      </Routes>
    </div>
  );
}

export default App;
